function getDateShowTime(nameTheater, status) {
  return {
    type: "GET_DATE_SHOWTIME",
    payload: nameTheater,
    status: status,
  };
}
function changeStatusDateByTheater(status) {
  return {
    type: "CHANGE_STATUS_DATE_BY_THEATER",
    status: status,
  };
}
export { getDateShowTime };
